window.bookSummaryJSON = "<p>Three unforgettable full-length novels by <i>NYT</i> best-selling author A.L. Jackson....</p> <p><i>Show Me the Way</i>: Rex Gunner. A sexy single dad with a huge chip on his shoulder. Can Rynna show him he deserves to be loved?</p> <p><i>Follow Me Back</i>: Dr. Kale Bryant is gorgeous, compelling, and married to his job. The only thing he has time for are one-night stands and short-lived flings. Until the day he meets Hope and his entire foundation is rocked.</p> <p><i>Lead Me Home</i>: Bar owner Oliver Preston knew better than to get close to Nikki. He’s always wanted her, but she was the one thing he couldn’t allow himself to have. But when she moves into his apartment after she’s threatened, she might become the one thing he cannot resist.</p> <p>Fall in love with the Men of Gingham Lakes and the women who change everything....</p>"; 
